result:
.modal-content{
    overflow: hidden;
    text-overflow: ellipsis;
    vertical-align: middle;
    white-space: nowrap;
}
.container {
    padding: 10px;
    display: flex;
    justify-content: space-between;
    width: 100%;
    background: #fafafa;
    border: 1px solid #edeff0;
    border-radius: 3px;
}
.isDefaultClass{
    margin-bottom:10px;
}
.flex-box-right{
    min-width: 60px;
    text-align: right;
}
.flex-box-right i{
    /*margin-left:10px;*/
    font-size:10px;
    padding:5px;
    cursor:pointer;
}
.flex-box-left{
    overflow: hidden;
    text-overflow: ellipsis;
    vertical-align: middle;
    white-space: nowrap;
}
.flex-box-left div{
    display:flex;
    align-items: center;
}
.flex-box-left div p{
    margin-left:10px;
    font-size:14px;
    width: 100%;
    overflow: hidden;
    text-overflow: ellipsis;
}
.flex-box-left p{
    margin-bottom:0px;
    font-size:12px;
    color:#4c555c;
    margin-left:20px
}
